import React, { useState } from "react";
import { Formik, Form, Field, ErrorMessage } from "formik";
import * as Yup from "yup";
import { FaUser, FaLock, FaCog, FaEnvelope, FaPhone } from "react-icons/fa";
import axios from "axios";

const ProfilePage = () => {
  const [submissionMessage, setSubmissionMessage] = useState("");

  const validationSchema = Yup.object({
    firstName: Yup.string().required("First name is required"),
    lastName: Yup.string().required("Last name is required"),
    displayName: Yup.string().required("Display name is required"),
    gender: Yup.string().required("Gender is required"),
    country: Yup.string().required("Country is required"),
    state: Yup.string().required("State is required"),
    language: Yup.string().required("Language is required"),
    timezone: Yup.string().required("Timezone is required"),
  });

  const handleSubmit = async (values, { setSubmitting, resetForm }) => {
    try {
      const response = await axios.post("http://localhost:5000/register", values, {
        headers: { "Content-Type": "application/json" },
      });

      setSubmissionMessage("Profile updated successfully!");
      resetForm();
    } catch (error) {
      setSubmissionMessage("Update failed. Please try again.");
    }
    setSubmitting(false);
  };

  return (
    <div className="flex h-screen">
      {/* Left Section (Profile Image + Form) */}
      <div className="w-1/3 bg-gray-100 p-6 flex flex-col items-center">
        {/* Profile Image */}
        <img
          src="C:\Users\kondr\Frentend\Frontend\public\logo160.png"
          alt="Profile"
          className="w-32 h-32 rounded-full mb-6"
        />

        {/* Registration Form */}
        <Formik
          initialValues={{
            firstName: "",
            lastName: "",
            displayName: "",
            gender: "",
            country: "",
            state: "",
            language: "",
            timezone: "",
          }}
          validationSchema={validationSchema}
          onSubmit={handleSubmit}
        >
          {({ isSubmitting }) => (
            <Form className="grid grid-cols-2 gap-4 w-full">
              {/* Form Fields in 2 Columns */}
              <div>
                <label htmlFor="firstName">First Name</label>
                <Field name="firstName" type="text" className="input-field" />
                <ErrorMessage name="firstName" component="div" className="error" />
              </div>

              <div>
                <label htmlFor="lastName">Last Name</label>
                <Field name="lastName" type="text" className="input-field" />
                <ErrorMessage name="lastName" component="div" className="error" />
              </div>

              <div>
                <label htmlFor="displayName">Display Name</label>
                <Field name="displayName" type="text" className="input-field" />
                <ErrorMessage name="displayName" component="div" className="error" />
              </div>

              <div>
                <label htmlFor="gender">Gender</label>
                <Field as="select" name="gender" className="input-field">
                  <option value="">Select Gender</option>
                  <option value="Male">Male</option>
                  <option value="Female">Female</option>
                  <option value="Other">Other</option>
                </Field>
                <ErrorMessage name="gender" component="div" className="error" />
              </div>

              <div>
                <label htmlFor="country">Country</label>
                <Field name="country" type="text" className="input-field" />
                <ErrorMessage name="country" component="div" className="error" />
              </div>

              <div>
                <label htmlFor="state">State</label>
                <Field name="state" type="text" className="input-field" />
                <ErrorMessage name="state" component="div" className="error" />
              </div>

              <div>
                <label htmlFor="language">Language</label>
                <Field name="language" type="text" className="input-field" />
                <ErrorMessage name="language" component="div" className="error" />
              </div>

              <div>
                <label htmlFor="timezone">Timezone</label>
                <Field name="timezone" type="text" className="input-field" />
                <ErrorMessage name="timezone" component="div" className="error" />
              </div>

              {/* Buttons */}
              <div className="col-span-2 flex justify-center gap-4 mt-4">
                <button type="submit" disabled={isSubmitting} className="btn-save">
                  {isSubmitting ? "Saving..." : "Save"}
                </button>
                <button type="button" onClick={() => window.location.reload()} className="btn-cancel">
                  Cancel
                </button>
              </div>
            </Form>
          )}
        </Formik>
      </div>

      {/* Right Section (Profile Info & Settings) */}
      <div className="w-2/3 bg-white p-6">
        {/* Header with Logo and Profile */}
        <div className="flex justify-between items-center mb-6">
          <h2 className="text-xl font-semibold">User Profile</h2>
          <div className="flex items-center gap-4">
            <img src="C:\Users\kondr\Frentend\Frontend\public\logo.png" alt="Logo" className="h-10" />
            <FaUser className="text-2xl" />
          </div>
        </div>

        {/* Profile Information */}
        <div className="space-y-4">
          <div className="flex items-center gap-2">
            <FaEnvelope className="text-xl" />
            <span>Email: user@example.com</span>
          </div>
          <div className="flex items-center gap-2">
            <FaPhone className="text-xl" />
            <span>Mobile: +123456789</span>
          </div>
          <div className="flex items-center gap-2">
            <FaLock className="text-xl" />
            <span>Security </span>
          </div>
          <div className="flex items-center gap-2">
            <FaCog className="text-xl" />
            <span>Settings</span>
          </div>
        </div>
      </div>
    </div>
  );
};

export default ProfilePage;
